sys_variable_value.value:
(function execute(inputs, outputs) {
    var utils = new OciObjectStorageManagementUtils();
    utils.validateInputVariables(inputs, outputs);
    utils.validateMandatoryVariables(inputs, ["tenancyId", "namespace", "name"]);
    utils.maptoOutputFromInput(inputs, outputs, ["namespace"]);
    var requestBody = new Object();
    if (inputs.tenancyId && inputs.compartmentId) {
        requestBody.compartmentId = inputs.compartmentId;
    } else {
        requestBody.compartmentId = inputs.tenancyId;
    }
    requestBody.name = inputs.name;
    var metadata = utils.createTagsPayload(inputs.metadata);
    if (Object.keys(metadata).length) {
        requestBody.metadata = metadata;
    }
    var tags = utils.createTagsPayload(inputs.freeformtags);
    if (Object.keys(tags).length) {
        requestBody.freeformTags = tags;
    }
    if (inputs.kmsKeyId) {
        requestBody.kmsKeyId = inputs.kmsKeyId;
    }
    if (inputs.objectEventsEnabled) {
        requestBody.objectEventsEnabled = inputs.objectEventsEnabled;
    }
    if (inputs.publicAccessType) {
        requestBody.publicAccessType = inputs.publicAccessType;
    }
    if (inputs.storageTier) {
        requestBody.storageTier = inputs.storageTier;
    }
    if (inputs.versioning) {
        requestBody.versioning = inputs.versioning;
    }
    outputs.payload = JSON.stringify(requestBody);
})(inputs, outputs);

